import axios from 'axios';

const PhysicalExaminationUrl="http://localhost:8080/cancerMoonshot/getphysicalexamination?id=1";

class Physicalexam{

    getApiP(){
        return axios.get(PhysicalExaminationUrl);
    }
}


export default new Physicalexam();
